class TestgridApp extends LitElement {
    /**
     * Lit-element lifecycle method.
     * Invoked on each update to perform rendering tasks.
     */
    render() {
        return html `<testgrid-router></testgrid-router>`;
    }
}

class TestgridDashboardSummary extends LitElement {
    constructor() {
        super(...arguments);
        this.dashboardName = '';
        this.tabSummariesInfo = [];
    }
    connectedCallback() {
        super.connectedCallback();
        this.fetchTabSummaries();
    }
    /**
     * Lit-element lifecycle method.
     * Invoked on each update to perform rendering tasks.
     */
    render() {
        return html `
      ${map(this.tabSummariesInfo, (ts) => html `<tab-summary .info=${ts}></tab-summary>`)}
  `;
    }
    // fetch the tab summaries and tab names to populate the tab bar
    async fetchTabSummaries() {
        try {
            const response = await fetch(`http://${process.env.API_HOST}:${process.env.API_PORT}/api/v1/dashboards/${this.dashboardName}/tab-summaries`);
            if (!response.ok) {
                throw new Error(`HTTP error: ${response.status}`);
            }
            const data = ListTabSummariesResponse.fromJson(await response.json());
            var tabSummaries = [];
            data.tabSummaries.forEach(ts => {
                const si = convertResponse(ts);
                tabSummaries.push(si);
            });
            this.tabSummariesInfo = tabSummaries;
        }
        catch (error) {
            console.error(`Could not get dashboard summaries: ${error}`);
        }
    }
}

class TestgridDataContent extends LitElement {
    constructor() {
        super(...arguments);
        this.tabNames = [];
        this.activeIndex = 0;
        this.showTab = false;
        this.dashboardName = '';
    }
    // set the functionality when any tab is clicked on
    onTabActivated(event) {
        const tabIndex = event.detail.index;
        if (tabIndex === this.activeIndex) {
            return;
        }
        this.tabName = this.tabNames[tabIndex];
        if (this.activeIndex === 0 || tabIndex === 0) {
            this.showTab = !this.showTab;
        }
        this.activeIndex = tabIndex;
        navigateTab(this.dashboardName, this.tabName);
    }
    /**
     * Lit-element lifecycle method.
     * Invoked when a component is added to the document's DOM.
     */
    connectedCallback() {
        super.connectedCallback();
        this.fetchTabNames();
    }
    /**
     * Lit-element lifecycle method.
     * Invoked on each update to perform rendering tasks.
     */
    render() {
        var tabBar = html `${
        // make sure we only render the tabs when there are tabs
        when(this.tabNames.length > 0, () => html `
        <mwc-tab-bar .activeIndex=${this.activeIndex} @MDCTabBar:activated="${this.onTabActivated}">
          ${map(this.tabNames, (name) => html `<mwc-tab label=${name}></mwc-tab>`)}
        </mwc-tab-bar>`)}`;
        return html `
      ${tabBar}
      ${!this.showTab ?
            html `<testgrid-dashboard-summary .dashboardName=${this.dashboardName}></testgrid-dashboard-summary>` :
            html `<testgrid-grid-display .dashboardName=${this.dashboardName} .tabName=${this.tabName}></testgrid-grid-display>`}
    `;
    }
    // fetch the tab names to populate the tab bar
    async fetchTabNames() {
        try {
            const response = await fetch(`http://${process.env.API_HOST}:${process.env.API_PORT}/api/v1/dashboards/${this.dashboardName}/tabs`);
            if (!response.ok) {
                throw new Error(`HTTP error: ${response.status}`);
            }
            const data = ListDashboardTabsResponse.fromJson(await response.json());
            var tabNames = ['Summary'];
            data.dashboardTabs.forEach(tab => {
                tabNames.push(tab.name);
            });
            this.tabNames = tabNames;
            this.highlightIndex(this.tabName);
        }
        catch (error) {
            console.error(`Could not get dashboard summaries: ${error}`);
        }
    }
    // identify which tab to highlight on the tab bar
    highlightIndex(tabName) {
        if (tabName === undefined) {
            return;
        }
        var index = this.tabNames.indexOf(tabName);
        if (index > -1) {
            this.activeIndex = index;
        }
    }
}

class TestgridGridCell extends LitElement {
    render() {
        return html `${this.icon}`;
    }
}

class TestgridGridColumnHeader extends LitElement {
    render() {
        return html `${this.name}`;
    }
}

class TestgridGridHeaderRow extends LitElement {
    render() {
        if (this.headers && this.headers.headers) {
            return html `
        <testgrid-grid-row-header></testgrid-grid-row-header>
        ${map(this.headers.headers, (header) => html `<testgrid-grid-column-header .name="${header.build}"></testgrid-grid-column-header>`)}
        `;
        }
        return html `
    <testgrid-grid-row-header></testgrid-grid-row-header>
    `;
    }
}

class TestgridGridRowHeader extends LitElement {
    render() {
        return html `${this.name}`;
    }
}

class TestgridGridRow extends LitElement {
    render() {
        if (this.rowData && this.rowData.cells) {
            return html `<testgrid-grid-row-header .name="${this.name}">
        </testgrid-grid-row-header>
        ${map(this.rowData.cells, (cell) => html `<testgrid-grid-cell .icon="${cell.icon}" .status="${TestStatus[cell.result]}"></testgrid-grid-cell>`)}
        `;
        }
        return html `
    <testgrid-grid-row-header .name="${this.name}"></testgrid-grid-row-header>
    `;
    }
}

class TestgridGrid extends LitElement {
    constructor() {
        super(...arguments);
        this.dashboardName = '';
        this.tabName = '';
        this.tabGridRows = [];
    }
    /**
     * Lit-element lifecycle method.
     * Invoked when element properties are changed.
     */
    willUpdate(changedProperties) {
        if (changedProperties.has('tabName')) {
            this.fetchTabGrid();
        }
    }
    /**
     * Lit-element lifecycle method.
     * Invoked on each update to perform rendering tasks.
     */
    render() {
        return html `
    <testgrid-grid-header-row .headers="${this.tabGridHeaders}"></testgrid-grid-header-row>
    ${map(this.tabGridRows, (row) => html `<testgrid-grid-row .name="${row.name}" .rowData="${row}"></testgrid-grid-row>`)}
    `;
    }
    async fetchTabGrid() {
        this.fetchTabGridRows();
        this.fetchTabGridHeaders();
    }
    async fetchTabGridRows() {
        this.tabGridRows = [];
        try {
            const response = await fetch(`http://${process.env.API_HOST}:${process.env.API_PORT}/api/v1/dashboards/${this.dashboardName}/tabs/${this.tabName}/rows`);
            if (!response.ok) {
                throw new Error(`HTTP error: ${response.status}`);
            }
            const data = ListRowsResponse.fromJson(await response.json());
            var rows = [];
            data.rows.forEach(row => rows.push(row));
            this.tabGridRows = rows;
        }
        catch (error) {
            console.error(`Could not get grid rows: ${error}`);
        }
    }
    async fetchTabGridHeaders() {
        try {
            const response = await fetch(`http://${process.env.API_HOST}:${process.env.API_PORT}/api/v1/dashboards/${this.dashboardName}/tabs/${this.tabName}/headers`);
            if (!response.ok) {
                throw new Error(`HTTP error: ${response.status}`);
            }
            const data = ListHeadersResponse.fromJson(await response.json());
            this.tabGridHeaders = data;
        }
        catch (error) {
            console.error(`Could not get grid headers: ${error}`);
        }
    }
}

class TestgridIndex extends LitElement {
    constructor() {
        super(...arguments);
        this.dashboards = [];
        this.dashboardGroups = [];
        this.respectiveDashboards = [];
        // toggles between the dashboards of a particular group or a dashboard without a group
        this.show = true;
    }
    /**
     * Lit-element lifecycle method.
     * Invoked when a component is added to the document's DOM.
     */
    connectedCallback() {
        super.connectedCallback();
        this.fetchDashboardGroups();
        this.fetchDashboards();
    }
    /**
     * Lit-element lifecycle method.
     * Invoked on each update to perform rendering tasks.
     */
    render() {
        return html `
      <div class="flex-container">
        <!-- loading dashboard groups -->
        <mwc-list style="min-width: 760px">
          ${map(this.dashboardGroups, (dash, index) => html `
              <mwc-list-item
                id=${index}
                class="column card dashboard-group"
                raised
                @click="${() => this.getRespectiveDashboards(dash)}"
              >
                <div class="container">
                  <p>${dash}</p>
                </div>
              </mwc-list-item>
            `)}
        </mwc-list>

        <!-- loading dashboards -->
        ${this.show ? dashboardTemplate(this.dashboards) : ''}

        <!-- loading respective dashboards -->
        ${!this.show ? dashboardTemplate(this.respectiveDashboards) : ''}
        ${!this.show ? html `
              <mwc-button class="column" raised @click="${() => this.show = !this.show}">X</mwc-button>
            `
            : ''}
      </div>
    `;
    }
    // fetch the the list of dashboards from the API
    async fetchDashboards() {
        try {
            fetch(`http://${process.env.API_HOST}:${process.env.API_PORT}/api/v1/dashboards`).then(async (response) => {
                const resp = ListDashboardResponse.fromJson(await response.json());
                const dashboards = [];
                resp.dashboards.forEach(db => {
                    dashboards.push(db.name);
                });
                this.dashboards = dashboards;
            });
        }
        catch (error) {
            console.log(`failed to fetch: ${error}`);
        }
    }
    // fetch the list of dashboard groups from API
    async fetchDashboardGroups() {
        try {
            fetch(`http://${process.env.API_HOST}:${process.env.API_PORT}/api/v1/dashboard-groups`).then(async (response) => {
                const resp = ListDashboardGroupResponse.fromJson(await response.json());
                const dashboardGroups = [];
                resp.dashboardGroups.forEach(db => {
                    dashboardGroups.push(db.name);
                });
                this.dashboardGroups = dashboardGroups;
            });
        }
        catch (error) {
            console.log(`failed to fetch: ${error}`);
        }
    }
    // fetch the list of respective dashboards for a group from API
    async getRespectiveDashboards(name) {
        this.show = false;
        try {
            fetch(`http://${process.env.API_HOST}:${process.env.API_PORT}/api/v1/dashboard-groups/${name}`).then(async (response) => {
                const resp = ListDashboardResponse.fromJson(await response.json());
                const respectiveDashboards = [];
                resp.dashboards.forEach(ts => {
                    respectiveDashboards.push(ts.name);
                });
                this.respectiveDashboards = respectiveDashboards;
            });
        }
        catch (error) {
            console.error(`Could not get dashboard summaries: ${error}`);
        }
    }
}

class TestgridRouter extends LitElement {
    constructor() {
        super(...arguments);
        this.router = new Router(this, [
            {
                path: '/:dashboard/*',
                render: (params) => html `<testgrid-data-content .dashboardName=${params.dashboard} .tabName=${params[0]} showTab></testgrid-data-content>`,
            },
            {
                path: '/:dashboard',
                render: (params) => html `<testgrid-data-content .dashboardName=${params.dashboard}></testgrid-data-content>`,
            },
            {
                path: '/',
                render: () => html `<testgrid-index></testgrid-index>`,
            },
        ]);
    }
    /**
     * Lit-element lifecycle method.
     * Invoked when a component is added to the document's DOM.
     */
    connectedCallback() {
        super.connectedCallback();
        window.addEventListener('location-changed', () => {
            this.router.goto(location.pathname);
        });
    }
    /**
     * Lit-element lifecycle method.
     * Invoked on each update to perform rendering tasks.
     */
    render() {
        return html `${this.router.outlet()}`;
    }
}

